import styled from "@emotion/styled";
import { NONAME } from "dns";
import { useEffect, useState } from "react";
import { Line } from "react-chartjs-2";
// import styled from "@emotion/styled/macro";

export default function LeftMenu() {
  // styles
  const [chartData, setChartData] = useState({});

  const chart = () => {
    setChartData({
      labels: [
        "23 сен",
        "24 сен",
        "25 сен",
        "26 сен",
        "27 сен",
        "28 сен",
        "29 сен",
      ],
      datasets: [
        {
          label: "Income",
          data: [0, 2700, 6500, 3250, 2100, 4900, 3000],
          borderColor: "#2E71F3",
          backgroundColor: "rgba(46,113,243,0.05)",
          borderWidth: 4,
        },
      ],
    });
  };
  const Container = styled.div`
    margin-left: 300px;
    margin-top: 150px;
    height: 200px;
    width: 565px;
  `;
  useEffect(() => {
    chart();
  }, []);
  return (
    <Container>
      <Line
        data={chartData}
        options={{
          responsive: true,
          maintainAspectRatio: false,
          legend: { display: false },
          scales: {
            xAxes: [
              {
                ticks: {
                  display: true,
                },
                gridLines: {
                  display: false,
                  drawBorder: false,
                },
              },
            ],
            yAxes: [
              {
                ticks: {
                  display: true,
                  callback: function (value, index, values) {
                    if (value > 5000) {
                      return "";
                    } else {
                      return value + "тыс. ₽";
                    }
                  },
                  max: 7000,
                },
                gridLines: {
                  display: true,
                  drawBorder: false,
                },
              },
            ],
          },
        }}
      ></Line>
    </Container>
  );
}
